TOTO CFS366BPN<table width="420" border="0" cellpadding="0" cellspacing="0"><tr><td><img src="http://www.rakuten.ne.jp/gold/jyusetu/img/item_title.gif"></td></tr><tr><td><table width="100%" border="0" cellpadding="20" cellspacing="1" bgcolor="#A0A0A0"><tr><td bgcolor="#ffffff"><font style="font-size:12px"><font color=red><br>
【こちらの商品は、「メーカー直送」です！】<br>
ご注意ください！<br>
■お支払い方法について<br>
「後払い」「クレジットカード」「銀行振込」「郵便振替」のみとなります(代金引換は不可)。<br>
■日時について<br>
メーカーに在庫があり、日にち指定がない場合は、翌日、または翌々日のお届けとなります。また時間は9時から17時の間でお届けとなります。時間指定、土(一部メーカーを除く)、日、祝、夜間の配送はできません。<br>
■ご連絡について<br>
配達前に運送会社よりお電話させて頂きますので、ご連絡が取れる電話番号(携帯電話など)をご注文フォームにご記入ください。<br>
■不在時の再配達について<br>
不在の場合は運送会社が持ち帰り、当日の再配達が出来かねます。また持ち帰り料・保管料・再配達料の手数料が発生する場合(お客様負担となります)がございます。ご了承くださいませ。<br>
■商品お渡しについて<br>
ドライバー1名で車上渡しとなりますので、階段搬入などはございません。<br>
■リクシル(LIXIL)商品の場合(旧INAX)<br>
通常4トン車の配送になります。だたし4トン車で配送出来ない場合は2トン車となりますが別途費用がかかります。あらかじめご了承ください。<br>
</font><br>
<BR>【規格・特徴】<br>
・壁排水：120mm<br>
・エロンゲートサイズ<br>
・汚れがこびり付きにくいセフィオンテクト<br>
・ツイントルネード<br>
・防露<br>
・洗浄水量：大6L・小4.8L<br>
・寒冷地･水抜方式（室内暖房併用）<br>
※便座は別売りです。<br>
<br>
【商品説明】<br>
メーカーカタログには載っていない集約現場向け商品のため、格安価格で販売！<br>
機能は一般の便器と変わりありません。セミサイホン式。<br>
<br>
<br>
※パステルピンクは、受注生産品となっております。ご注文後、約2週間（営業日）必要です。<br>
<br>
